import 'bootstrap/dist/css/bootstrap.min.css';
import Home from './pages/Home';
import React from 'react';

import {
  BrowserRouter as Router,
  Route,
  Switch
} from 'react-router-dom'


export default function App() {
  return (
    <Router>
        <Switch>
          <Route path="/" component={Home} exact />
        </Switch>
    </Router>

  );
}
